import React from 'react';
import {Helmet} from "react-helmet";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import logo from './logo.svg';
import './App.css';

const TITLE = 'Scroll Loop Menu | Zak Weiland'

function App() {
  return (
    <Router>
      <Helmet>
        <title>{ TITLE }</title>
      </Helmet>
      <div className="App">
        <nav class="menu">
          <div class="menu__item"><Link class="menu__item-inner">Fascination Street</Link></div>
          <div class="menu__item"><Link class="menu__item-inner">The Last Dance</Link></div>
          <div class="menu__item"><Link class="menu__item-inner">Rebel Fantasies</Link></div>
          <div class="menu__item"><Link class="menu__item-inner">Love Letters to Cipher</Link></div>
          <div class="menu__item"><Link class="menu__item-inner">Henry and the Kids</Link></div>
          <div class="menu__item"><Link class="menu__item-inner">Downtown Blank</Link></div>
          <div class="menu__item"><Link class="menu__item-inner">Georgetown Blues</Link></div>
          <div class="menu__item"><Link class="menu__item-inner">When Alice comes</Link></div>
          <div class="menu__item"><Link class="menu__item-inner">A Rabbit's Dream</Link></div>
          <div class="menu__item"><Link class="menu__item-inner">Schizophrenia House</Link></div>
          <div class="menu__item"><Link class="menu__item-inner">Foundation Fabrics</Link></div>
          <div class="menu__item"><Link class="menu__item-inner">Whenever Whatever</Link></div>
          <div class="menu__item"><Link class="menu__item-inner">Feathers of Babel</Link></div>
          <div class="menu__item"><Link class="menu__item-inner">Golden Freckles</Link></div>
        </nav>
      </div>
    </Router>
  );
}

export default App;
